import { Component } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {

  firstName!: string;
  lastName!: string;
  email!: string;
  userType!: string;
  dob!: Date;
  username!: string;
  password!: string;
  mobile!: string;
  address!: string;
  zipcode!: string;
  profileImage: File;
  state: string;
  country: string;



register(){}

}
